@Component({
  selector: 'app-poke-list',
  templateUrl: './poke-list.component.html',
  styleUrls: ['./poke-list.component.scss']
})
export class PokeListComponent {

}
<a class="pokemon">
  <section class="pokemon_status">
    <h2>Nome</h2>
    <ul>
      <li>Tipo 1</li>
      <li>Tipo 2</li>
    </ul>
  </section>
</a>
